// import List from "./List";
import * as ass from "./Heading";
import * as cal from "./Cal.jsx";
import './index.css';

function Calapp(){
    return (
    <>
        <div className="header">
        <ass.default/>
        <h1>add {cal.default(40,10)}</h1>
        <h1>sub {cal.sub(40,10)}</h1>
        <h1>mul {cal.mul(40,10)}</h1>
        <h1>div {cal.div(10,3)}</h1>
        </div>
    </>
    );
    
}

function Cardapp(){
    return (
        <>
            <ass.Card
                imgsrc = "https://m.media-amazon.com/images/M/MV5BZjZjNzI5MDctY2Y4YS00NmM4LTljMmItZTFkOTExNGI3ODRhXkEyXkFqcGdeQXVyNjc3MjQzNTI@._V1_.jpg"
                title = "Demon Slayer: Kimetsu no Yaiba"
                link = "https://www2.kickassanime.ro/anime/kimetsu-no-yaiba-dub-241925"
                catorg = "Blood Action"
            />
        </>
    )
}



export default Cardapp;
